import Carrousel from "../components/Carrousel"
import { useParams } from 'react-router-dom'

function Lodging() {
    const { lodgingId } = useParams()
    return(
        <main>
            <Carrousel />
            <div>{lodgingId}</div>
        </main>
    )
}

export default Lodging
